import React, { Component } from "react";
import Players from "./players";
import DayPicker from "./common/date-picker";

class Games extends Component {
  state = {
    date: {},
  };

  render() {
    return (
      <div>
        <DayPicker />
        <Players />
        <table border="2">
          <thead>
            <tr>
              <td>3</td>
            </tr>
          </thead>
          <tbody>
            <tr></tr>
          </tbody>
        </table>
      </div>
    );
  }
}

export default Games;
